Prašome nušienauti:
sklypą tarp Tarandės g. ir RIMI prekybos centro – kol kas nebuvo šienautas nė karto;
prie Šulco ir Tarandės gatvių sankryžos plačiai nušienauti aukštą žolę -  trukdo matomumui vairuotojams;
Tarandės, Šulco, Pikutiškių, Kelpių gatvių pakelėse šiemet žolė buvo nupjauta tik apie 50 cm pločio (Tarandėje nėra šaligatvių ir pėstieji turi eiti pakele, todėl prašome pakeles šienauti plačiai);
nupjauti žolę prie Kelpių ir Lasavicko gatvių sankryžos esančiame valstybiniame sklype; nušienauti pakeles Benykštaičių gatvėje – šiemet nebuvo šienauta.

Dėl šulinio igriovos

&#34; JŪSŲ ATSAKYMAS Pastatyta gairelė rodo, kad avarinė tarnyba užfiksavo įgriuvą, ją pažymėjo ir informavo šulinio savininką. Neturime duomenų, kiek reikia laiko įgriuvos tvarkymui. Pirmiausia turi būti pašalinta įgriuvos priežastis (vamzdyne), o vėliau sutvarkoma šaligatvio danga.&#34;

